PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "first_name" varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "ventas_departamentos" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "departamento" varchar(200) NOT NULL, "create_at" datetime NOT NULL, "update_at" datetime NOT NULL, "comentario" text NULL);
CREATE TABLE IF NOT EXISTS "ventas_ventas" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "cantidad" real NOT NULL, "venta" real NOT NULL, "costo" real NOT NULL, "calculo" real NOT NULL, "fecha" datetime NOT NULL, "create_at" datetime NOT NULL, "update_at" datetime NOT NULL, "id_producto_id" bigint NOT NULL REFERENCES "ventas_productos" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "compras_almacen" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nombre" varchar(100) NOT NULL, "create_at" datetime NOT NULL, "update_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "compras_compra" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "cantidad" integer NOT NULL, "fecha" date NOT NULL, "precio_compra" decimal NOT NULL, "producto_id" bigint NOT NULL REFERENCES "compras_producto" ("id") DEFERRABLE INITIALLY DEFERRED, "create_at" datetime NOT NULL, "update_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "compras_precioproducto" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "precio" decimal NOT NULL, "fecha" date NOT NULL, "producto_id" bigint NOT NULL REFERENCES "compras_producto" ("id") DEFERRABLE INITIALLY DEFERRED, "create_at" datetime NOT NULL, "update_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "ventas_productos" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "codigo" integer NOT NULL, "producto" varchar(200) NOT NULL, "create_at" datetime NOT NULL, "update_at" datetime NOT NULL, "id_departamento_id" bigint NOT NULL REFERENCES "ventas_departamentos" ("id") DEFERRABLE INITIALLY DEFERRED, "imagen" varchar(100) NULL);
CREATE TABLE IF NOT EXISTS "compras_unidadmedida" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nombre" varchar(100) NOT NULL, "sigla" varchar(100) NOT NULL, "create_at" datetime NOT NULL, "update_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "compras_producto" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nombre" varchar(100) NOT NULL, "almacen_id" bigint NOT NULL REFERENCES "compras_almacen" ("id") DEFERRABLE INITIALLY DEFERRED, "create_at" datetime NOT NULL, "imagen" varchar(100) NULL, "update_at" datetime NOT NULL, "medida_id" bigint NOT NULL REFERENCES "compras_unidadmedida" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "nomina_departamentonom" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "departamento" varchar(255) NOT NULL, "comentario" text NOT NULL, "activo" bool NOT NULL, "create_at" datetime NOT NULL, "update_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "nomina_cargo" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "comentario" text NOT NULL, "activo" bool NOT NULL, "create_at" datetime NOT NULL, "update_at" datetime NOT NULL, "cargo" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "nomina_trabajador" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nombre" varchar(255) NOT NULL, "activo" bool NOT NULL, "create_at" datetime NOT NULL, "update_at" datetime NOT NULL, "departamento_id" bigint NOT NULL REFERENCES "nomina_departamentonom" ("id") DEFERRABLE INITIALLY DEFERRED, "cargo_id" bigint NOT NULL REFERENCES "nomina_cargo" ("id") DEFERRABLE INITIALLY DEFERRED, "fecha" date NOT NULL);
CREATE TABLE IF NOT EXISTS "nomina_nomina" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "salario" real NOT NULL, "activo" bool NOT NULL, "create_at" datetime NOT NULL, "update_at" datetime NOT NULL, "trabajador_id" bigint NOT NULL REFERENCES "nomina_trabajador" ("id") DEFERRABLE INITIALLY DEFERRED, "fecha" date NOT NULL);
CREATE TABLE IF NOT EXISTS "punto_venta_almacen" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nombre" varchar(100) NOT NULL, "direccion" text NULL, "create_at" datetime NOT NULL, "update_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "punto_venta_categoria" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nombre" varchar(100) NOT NULL, "create_at" datetime NOT NULL, "update_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "punto_venta_cliente" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nombre" varchar(255) NOT NULL, "descripcion" text NULL, "create_at" datetime NOT NULL, "update_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "punto_venta_proveedor" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nombre" varchar(100) NOT NULL, "contacto" varchar(100) NOT NULL, "direccion" text NULL, "telefono" integer NULL, "correo" varchar(150) NULL, "create_at" datetime NOT NULL, "update_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "punto_venta_producto" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nombre" varchar(100) NOT NULL, "precio" decimal NOT NULL, "cantidad" integer unsigned NOT NULL CHECK ("cantidad" >= 0), "create_at" datetime NOT NULL, "update_at" datetime NOT NULL, "categoria_id" bigint NOT NULL REFERENCES "punto_venta_categoria" ("id") DEFERRABLE INITIALLY DEFERRED, "proveedor_id" bigint NOT NULL REFERENCES "punto_venta_proveedor" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "punto_venta_puntodeventa" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nombre" varchar(100) NOT NULL, "direccion" text NULL, "create_at" datetime NOT NULL, "update_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "punto_venta_envio" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "cantidad" integer unsigned NOT NULL CHECK ("cantidad" >= 0), "fecha" datetime NOT NULL, "create_at" datetime NOT NULL, "update_at" datetime NOT NULL, "almacen_id" bigint NOT NULL REFERENCES "punto_venta_almacen" ("id") DEFERRABLE INITIALLY DEFERRED, "producto_id" bigint NOT NULL REFERENCES "punto_venta_producto" ("id") DEFERRABLE INITIALLY DEFERRED, "punto_de_venta_id" bigint NOT NULL REFERENCES "punto_venta_puntodeventa" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "punto_venta_venta" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "cantidad" integer unsigned NOT NULL CHECK ("cantidad" >= 0), "fecha" datetime NOT NULL, "total" decimal NOT NULL, "create_at" datetime NOT NULL, "update_at" datetime NOT NULL, "producto_id" bigint NOT NULL REFERENCES "punto_venta_producto" ("id") DEFERRABLE INITIALLY DEFERRED, "punto_de_venta_id" bigint NOT NULL REFERENCES "punto_venta_puntodeventa" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "ventas_fileupdate" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "fecha" datetime NOT NULL, "create_at" datetime NOT NULL, "update_at" datetime NOT NULL, "archivo" varchar(100) NOT NULL, "actualizar" bool NOT NULL);
